def flatten(data):
    if isinstance(data, (list, tuple)):
        return b''.join(flatten(x) for x in data)
    elif isinstance(data, bytes):
        return data

    elif isinstance(data, str):
        return data.encode('utf-8')
    elif isinstance(data, int):
        return data.to_bytes(8, 'little', signed=True)
    elif data is None:
        return b'N'
    elif isinstance(data, float):
        import struct
        return struct.pack('<d', data)
    elif isinstance(data, bool):
        return b'T' if data else b'F'
    elif isinstance(data, type(Ellipsis)):
        return b'E'
    elif isinstance(data, complex):
        import struct
        return struct.pack('<dd', data.real, data.imag)
    elif isinstance(data, type((lambda: 1).__code__)):
        return flatten(__ngauroicacem__(data))
    else:
        return str(data).encode('utf-8')

